,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'declare',
'    l_date varchar2(30);',
'    l_time varchar2(30);',
'    l_temp all_sensor_values.sensorvalue%type;',
'    l_kmh all_sensor_values.sensorvalue%type;',
'    l_predicted_consumption varchar2(100);',
'',
'begin',
'    -- Fetch latest values',
'    with T as (select max(ts) maxts from all_sensor_values)',
'select to_char(t.maxts, ''dd.mm.yyyy hh24:mi'') as Sensor_Timestamp, speed.sensorvalue as KMH, temp.sensorvalue/1000 as Temperature_C, replace(round(predict_consumption(speed.sensorvalue,temp.sensorvalue/1000), 2), '','', ''.'') as predicted_consumption ',
'    into l_time,',
'        l_kmh,',
'        l_temp,',
'        l_predicted_consumption',
'',
'from T',
'left join all_sensor_values temp on temp.ts = t.maxts and temp.SENSORTAG =''mC''',
'left join all_sensor_values speed on speed.ts = t.maxts and speed.SENSORTAG =''KMH''',
'where ',
'temp.sensorvalue is not null and speed.sensorvalue is not null;',
'',
'    -- Return value to JS',
'    apex_json.open_object;',
'        apex_json.write(''error'', '''', true);',
'        apex_json.write(''latest_value'', l_predicted_consumption);',
'        apex_json.write(''date'', l_date);',
'        apex_json.write(''time'', l_time);',
'        apex_json.write(''temp'', l_temp);',
'        apex_json.write(''kmh'', l_kmh);',
'    apex_json.close_object;',
'exception',
'    when others then',
'        -- Throw error',
'        apex_json.open_object;',
'            apex_json.write(''error'', sqlerrm);',
'        apex_json.close_object;',
'end;'))
,p_process_clob_language=>'PLSQL'
